// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts-upgradeable/token/ERC20/SafeERC20Upgradeable.sol";
import './NFTPool.sol';

contract PrivateNFTPool is NFTPool {
    using SafeERC20Upgradeable for IERC20Upgradeable;

    bytes32 public constant POOL_MEMBER = keccak256('POOL_MEMBER');

    int128 public maxOperatorOwnerFee;
    int128 public maxWeaponOwnerFee;
    uint256 public extensionFee;

    function initialize(
        IGameMaster _gameMaster,
        address _poolAdmin,
        int128 _maxOperatorOwnerFee,
        int128 _maxWeaponOwnerFee
    ) public virtual initializer {
        super.initialize(_gameMaster, _poolAdmin);

        maxOperatorOwnerFee = _maxOperatorOwnerFee;
        maxWeaponOwnerFee = _maxWeaponOwnerFee;

        _setRoleAdmin(POOL_MEMBER, POOL_ADMIN);
    }

    function deposit(IERC721Upgradeable token, uint256 tokenId) public override onlyPoolAdmin {
        super.deposit(token, tokenId);
    }

    function fight(
        uint256 operatorId,
        uint256 weaponId,
        IGameMaster.Target memory target,
        uint8 fightMultiplier
    ) public override onlyPoolMember {
        super.fight(operatorId, weaponId, target, fightMultiplier);
    }

    function setFeeDistribution(int128 _operatorOwnerFee, int128 _weaponOwnerFee) public override onlyPoolAdmin {
        require(_operatorOwnerFee < maxOperatorOwnerFee, '_operatorOwnerFee is too high');
        require(_weaponOwnerFee < maxWeaponOwnerFee, '_weaponOwnerFee is too high');

        operatorOwnerFee = _operatorOwnerFee;
        weaponOwnerFee = _weaponOwnerFee;
    }

    function extendInventoryLimit(IERC721Upgradeable token, uint32 sizeIncrease) public onlyPoolAdmin {
        uint256 extensionTotalFee = extensionFee.mul(sizeIncrease);
        require(rewardToken.allowance(msg.sender, address(this)) >= extensionTotalFee, 'Not enough allowance');
        rewardToken.safeTransferFrom(msg.sender, treasury, extensionTotalFee);

        inventoryLimit[token] = inventoryLimit[token].add(sizeIncrease);
    }

    function setExtensionFee(uint256 _fee) public onlyGameController {
        extensionFee = _fee;
    }

    modifier onlyPoolMember() {
        require(hasRole(POOL_MEMBER, msg.sender), 'POOL_MEMBER role needed.');
        _;
    }
}
